import React from 'react';
import {Button as MuiButton} from "@mui/material";



export default function Button(props) {

    const {text, size, color, varient, onClick, ...other} = props

    return (
        <MuiButton
        variant={varient}
        size={size}
        color={color}
        onClick={onClick}>
            {}
            {text}
        </MuiButton>
    );
}
